import React from 'react'
import '../css/appointment.css'

const Appointment = () => {
  return (
    <div className="appointment">
        <div className="appointment-header">
        <h2>Kamil's Barber Shop</h2>
        </div>
    <p>Professional services</p>
  </div>
  )
}

export default Appointment
